import { TextField } from "@mui/material";
import axios from "axios";
import { useEffect, useState } from "react";
import Table from "./Table";
import "./main.css";

const HomePage = () => {
  const [state, setState] = useState({
    datas: [],
  });
  useEffect(() => {
    getUuser();
  }, []);
  const getUuser = () => {
    axios
      .get("https://mongo6.sultantracker.com/api/bincry/sold")
      .then((res) => {
        const data = res.data;
        console.log(data);
        const old = { ...state };
        old.datas = data;
        setState(old);
      });
  };

  const totalBuyingPrice = state.datas.reduce(
    (acc, item) => acc + item.buying_amount,
    0
  );
  const totalSeelingPrice = state.datas.reduce(
    (acc, item) => acc + item.selling_amount,
    0
  );

  const totalProfit = totalSeelingPrice - totalBuyingPrice;
  console.log("dddd", totalProfit);

  //   const byePrice = () => {};
  //   const bbb = state.datas[0].buying_amount;
  //   console.log("byeing price is :", bbb);
  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        background: "gray",
        display: "flex",
        flexDirection: "column",
      }}
    >
      <div style={{ flex: 2, display: "flex" }}>
        <div style={{ flex: 6, display: "flex", color: "white" }}>
          <div
            style={{
              flex: 3.33,
              display: "flex",
              flexDirection: "column",
              justifyContent: "center",
              alignItems: "center",
            }}
          >
            <h3>BUYING AMOUNT</h3>
            <div
              style={{
                height: "40%",
                width: "40%",
                border: "1px solid black",
                display: "flex",
                alignItem: "center",
                justifyContent: "center",
              }}
            >
              {totalBuyingPrice.toFixed(4)}
            </div>
          </div>
          <div
            style={{
              flex: 3.33,
              display: "flex",
              flexDirection: "column",
              justifyContent: "center",
              alignItems: "center",
            }}
          >
            <h3>SELLING AMOUNR</h3>
            <div
              style={{
                height: "40%",
                width: "40%",
                border: "1px solid black",
                display: "flex",
                alignItem: "center",
                justifyContent: "center",
              }}
            >
              {totalSeelingPrice.toFixed(4)}
            </div>
          </div>
          <div
            style={{
              flex: 3.33,
              display: "flex",
              flexDirection: "column",
              justifyContent: "center",
              alignItems: "center",
            }}
          >
            <h3>TOTAL PROFIT</h3>
            <div
              style={{
                height: "40%",
                width: "40%",
                border: "1px solid black",
                display: "flex",
                alignItem: "center",
                justifyContent: "center",
              }}
            >
              {totalProfit.toFixed(4)}
            </div>
          </div>
        </div>
        <div
          style={{
            flex: 4,
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <TextField
            style={{ height: 80, width: "70%", padding: 20 }}
            placeholder="Search..."
            type="search"
          />
        </div>
      </div>
      <div
        style={{
          flex: 8,
          background: "red",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <div
          style={{
            height: "99%",
            width: "99%",
            background: "white",
            display: "flex",
            flexDirection: "column",
          }}
        >
          <div
            style={{
              flex: 1,
              width: "100%",
              background: "skyblue",
              display: "flex",
            }}
          >
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>BUYING PRICE</h4>
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>BUYING QUANTITY</h4>
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>BUYING AMOUNT</h4>
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>SELLING AMOUNT</h4>
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>SELLING QUANTITY</h4>
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>CURRENCY</h4>
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>INSERT DATE</h4>
          </div>
          <div
            style={{
              flex: 9,
              width: "100%",
            }}
          >
            <div style={{ height: "99%", width: "100%", overflowY: "scroll" }}>
              {state.datas.map((item, i) => (
                <Table item={item} key={i} />
              ))}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
